import React from 'react';
import { Stories } from 'react-insta-stories';

function MCStories(props) {
  return (
    <div>
      <Stories
        stories={[
          { url: process.env.PUBLIC_URL + "/assets/giphy.gif" },
          { url: process.env.PUBLIC_URL + "/assets/giphy.gif" }
        ]}
        defaultInterval={1500}
		    width={432}
		    height={768}
      />
    </div>
  );
}

export default MCStories;
